webpackJsonp([0xb6632881516d],{9105:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Turkey Day",date:"22 Nov 2001",slug:"/2001-11-22-turkey-day/",tags:"Y2001"},html:'<p>No holiday here, just a normal work day, and no turkey. Just a glass (or two) this evening of <a href="http://www.beaujolais.net/eng/page.htm">Beaujolais Nouveau</a> (known here as <a href="http://www.beaujolais.net/deu/page.htm">Beaujolais primeur</a>).</p>\n<p>A sobering work day today. A sysadmin knows in the back of her mind that the real threats to her network are internal, not external. But it\'s still a shock when that shadow in the back of her mind becomes real. I didn\'t choose this profession for the joy of spying on my co-workers. But my firm pays me, among other things, to protect its assets. But some parts of that job are no fun at all.</p>\n<p>DaveNet: <a href="http://davenet.userland.com/2001/11/22/aWebThanksgiving">A Web Thanksgiving</a> "Thanks to the RIAA, Disney  and other media companies who remove their content from public networks creating room for new musicians, creative artists and journalists to take their place."</p>'},next:{fields:{title:"School's out!",date:"21 Nov 2001",slug:"/2001-11-21-schools-out/"}},previous:{fields:{title:"I'm Thankful for Deutsche Telekom",date:"24 Nov 2001",slug:"/2001-11-24-im-thankful-for-deutsche-telekom/"}}},{node:{fields:{title:"School's out!",date:"21 Nov 2001",slug:"/2001-11-21-schools-out/",tags:"Y2001"},html:'<p><b><a href="http://andrea.editthispage.com/2001/11/20">WheeeeeeeeeeeeEEEEEEEEeeeeeeeeeeeee!!!</a></b><br />\n No more homework, no more books, no more teachers\' dirty looks!</p>'},next:{fields:{title:"Rockaway Beach",date:"19 Nov 2001",slug:"/2001-11-19-rockaway-beach/"}},previous:{fields:{title:"Turkey Day",date:"22 Nov 2001",slug:"/2001-11-22-turkey-day/"}}},{node:{fields:{title:"Rockaway Beach",date:"19 Nov 2001",slug:"/2001-11-19-rockaway-beach/",tags:"Y2001"},html:'<p><font color="#006600">Rock, rock, Rocaway Beach<br />\nRock, rock, Rockaway Beach<br />\nRock, rock, Rockaway Beach<br />\nWe can hitch a ride to <a href="http://www.levity.com/brooklyn/Queens/QnsBeach.html">Rockaway Beach</a></font><br />\n...The <a href="http://www.rollingstone.com/artists/bio.asp?oid=261&cf=261">Ramones</a><br />\n(with apologies to  <a href="http://www.vfth.com">Alwin</a>...)</p>\n<p>Mama\'s gone this entire week in Munich-land, first presenting her annual budget to the board, then babysitting millionaires, so Christopher and I are sticking it out alone at home.</p>\n<p>It\'s nice to see that the Harry Potter movie is being <a href="http://jrobb.userland.com/2001/11/19.html#664">so</a> <a href="http://scobleizer.manilasites.com/2001/11/17">well</a> <a href="http://slashdot.org/article.pl?sid=01/11/17/1441202&mode=thread">received</a>. It opens here in Germany this Thursday, but we\'ll probably wait to see it until we are in Minnesota next month. By then the lines should be down.</p>\n<p>That insect that lighted at the bottom of my link list is a <a href="http://blackholebrain.editthispage.com/2001/11/19">blogfly</a>, first bred at <a href="http://blackholebrain.editthispage.com/">blackholebrain</a>.</p>'},next:{fields:{title:"Foggy Bottom",date:"17 Nov 2001",slug:"/2001-11-17-foggy-bottom/"}},previous:{fields:{title:"School's out!",date:"21 Nov 2001",slug:"/2001-11-21-schools-out/"}}}],pathPrefix:"",first:!1,last:!1,index:959,pageCount:1101}}}});
